<H1><A NAME="vcreflinkertoolswarninglnk4199"></A>Linker Tools Warning LNK4199</H1>

<P class=dt><B>/DELAYLOAD:</B><I>dllname</I><B> ignored; no imports found from </B><I>dllname</I></P>

<P>The linker ignores <I>dllname</I> because it does not need any of the functions that <I>dllname</I> exports.</P>
